  }

  const handleInfraredLightHeadTrackerClick = () =>
  {
    setProjectClicked("InfraredLightHeadTracker");
  }

  const Button = ({style, text, onClick}) =>
  {
    return(
      <button type="button" className={style} onClick={onClick}>
